import React, { useState } from 'react';
import { questions, quizResultDescriptions } from './data';
import './App.css';

const QuizPage = () => {
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  // answers will store the selected option index for each question id
  const [answers, setAnswers] = useState({});
  const [result, setResult] = useState(null);

  const handleChange = (questionId, selectedOptionIndex) => {
    setAnswers({
      ...answers,
      [questionId]: selectedOptionIndex,
    });
  };

  const goToNextQuestion = () => {
    if (currentQuestionIndex < questions.length - 1) {
      setCurrentQuestionIndex(currentQuestionIndex + 1);
    }
  };

  const goToPreviousQuestion = () => {
    if (currentQuestionIndex > 0) {
      setCurrentQuestionIndex(currentQuestionIndex - 1);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Initialize scores for each animal
    const scores = {
      Squirrel: 0,
      Penguin: 0,
      Owl: 0,
      Fox: 0,
      Raccoon: 0,
      Cheetah: 0,
      "Golden Retriever": 0,
      Capybara: 0,
    };

    // Iterate over each question and add the corresponding option’s scores
    questions.forEach((question) => {
      const answerIndex = answers[question.id];
      if (answerIndex !== undefined) {
        const selectedOption = question.options[answerIndex];
        for (let animal in selectedOption.score) {
          scores[animal] += selectedOption.score[animal];
        }
      }
    });

    // Determine the highest scoring animal(s)
    const maxScore = Math.max(...Object.values(scores));
    const topAnimals = Object.keys(scores).filter(animal => scores[animal] === maxScore);

    let resultDescription;
    if (topAnimals.length === 1) {
      resultDescription = quizResultDescriptions[topAnimals[0]];
    } else {
      // If there's a tie, generate a hybrid personality result.
      const hybridKey = topAnimals.join(" x ");
      resultDescription = {
        title: `Hybrid Personality: ${hybridKey}`,
        intro:
          "You embody a mix of financial qualities that make you uniquely versatile. Embrace the best traits from each side of your personality!",
        strengths: [
          "Unique blend of strengths from: " + topAnimals.join(", ")
        ],
        weaknesses: [
          "A combined set of challenges might slow down your decision making."
        ],
        waysToImprove: [
          "Focus on leveraging your combined strengths to optimize your financial strategy, and remember: a little balance goes a long way."
        ],
      };
    }

    setResult(resultDescription);
  };

  const currentQuestion = questions[currentQuestionIndex];

  return (
    <div className="quiz-page">
      <div className="quiz-header">
        <h2>
          Ultimate Financial Personality Quiz – The Internet Animal Edition
        </h2>
        <p>
          Answer a few fun questions to reveal your unique financial habits in the most brutally honest way possible.
        </p>
      </div>
      <form onSubmit={handleSubmit}>
        <div className="question-card">
          <h3>{`Question ${currentQuestion.id} of ${questions.length}`}</h3>
          <p>{currentQuestion.question}</p>
          <div className="options-container">
            {currentQuestion.options.map((option, index) => (
              <label key={index} className="option-label">
                <input
                  type="radio"
                  name={`question-${currentQuestion.id}`}
                  value={index}
                  checked={answers[currentQuestion.id] === index}
                  onChange={() => handleChange(currentQuestion.id, index)}
                  required
                />
                <span className="option-text">{option.option}</span>
              </label>
            ))}
          </div>
        </div>
        <div className="nav-buttons">
          <button
            type="button"
            className="nav-btn"
            onClick={goToPreviousQuestion}
            disabled={currentQuestionIndex === 0}
          >
            ← Previous
          </button>
          {currentQuestionIndex < questions.length - 1 ? (
            <button type="button" className="nav-btn" onClick={goToNextQuestion}>
              Next →
            </button>
          ) : (
            <button type="submit" className="submit-btn">
              Submit Quiz
            </button>
          )}
        </div>
      </form>
      {result && (
        <div className="result-container">
          <h3>{result.title}</h3>
          <p>{result.intro}</p>
          <div className="result-section">
            <h4>Strengths:</h4>
            <ul>
              {result.strengths.map((strength, i) => (
                <li key={i}>{strength}</li>
              ))}
            </ul>
          </div>
          <div className="result-section">
            <h4>Weaknesses:</h4>
            <ul>
              {result.weaknesses.map((weakness, i) => (
                <li key={i}>{weakness}</li>
              ))}
            </ul>
          </div>
          <div className="result-section">
            <h4>Ways to Improve:</h4>
            <ul>
              {result.waysToImprove.map((tip, i) => (
                <li key={i}>{tip}</li>
              ))}
            </ul>
          </div>
        </div>
      )}
    </div>
  );
};

export default QuizPage;
